    public dynamic class func drawKeyBackground(frame targetFrame: CGRect = CGRect(x: 0, y: 0, width: 188, height: 138), resizing: ResizingBehavior = .aspectFit) {
        //// General Declarations
        let context = UIGraphicsGetCurrentContext()!
        
        //// Resize to Target Frame
        context.saveGState()
        let resizedFrame: CGRect = resizing.apply(rect: CGRect(x: 0, y: 0, width: 188, height: 138), target: targetFrame)
        context.translateBy(x: resizedFrame.minX, y: resizedFrame.minY)
        context.scaleBy(x: resizedFrame.width / 188, y: resizedFrame.height / 138)
        let resizedShadowScale: CGFloat = min(resizedFrame.width / 188, resizedFrame.height / 138)


        //// Color Declarations
        let keyFrameColor = UIColor(red: 0.008, green: 0.008, blue: 0.008, alpha: 1.000)
        let keyBackgroundColor = UIColor(red: 0.374, green: 0.474, blue: 0.463, alpha: 1.000)
        let keyHighlightColor = keyBackgroundColor.highlight(withLevel: 0.328)
        let keyShadowColor = keyBackgroundColor.shadow(withLevel: 0.56)

        //// Shadow Declarations
        let keyLightShadow = NSShadow()
        keyLightShadow.shadowColor = keyHighlightColor
        keyLightShadow.shadowOffset = CGSize(width: 4, height: 4)
        keyLightShadow.shadowBlurRadius = 2
        let keyDarkShadow = NSShadow()
        keyDarkShadow.shadowColor = keyShadowColor
        keyDarkShadow.shadowOffset = CGSize(width: -3, height: -3)
        keyDarkShadow.shadowBlurRadius = 5

        //// Background Drawing
        let backgroundPath = UIBezierPath(rect: CGRect(x: 2, y: 2, width: 184, height: 134))
        keyBackgroundColor.setFill()
        backgroundPath.fill()

        ////// Background Inner Shadow
        context.saveGState()
        context.clip(to: backgroundPath.bounds)
        context.setShadow(offset: CGSize.zero, blur: 0)
        context.setAlpha((keyLightShadow.shadowColor as! UIColor).cgColor.alpha)
        context.beginTransparencyLayer(auxiliaryInfo: nil)
        let backgroundOpaqueShadow = (keyLightShadow.shadowColor as! UIColor).withAlphaComponent(1)
        context.setShadow(offset: CGSize(width: keyLightShadow.shadowOffset.width * resizedShadowScale, height: keyLightShadow.shadowOffset.height * resizedShadowScale), blur: keyLightShadow.shadowBlurRadius * resizedShadowScale, color: backgroundOpaqueShadow.cgColor)
        context.setBlendMode(.sourceOut)
        context.beginTransparencyLayer(auxiliaryInfo: nil)

        backgroundOpaqueShadow.setFill()
        backgroundPath.fill()

        context.endTransparencyLayer()
        context.endTransparencyLayer()
        context.restoreGState()

        keyFrameColor.setStroke()
        backgroundPath.lineWidth = 3
        backgroundPath.stroke()


        //// Bottom Shadow Drawing
        let bottomShadowPath = UIBezierPath(rect: CGRect(x: 1, y: 1, width: 186, height: 136))
        UIColor.clear.setFill()
        bottomShadowPath.fill()

        ////// Bottom Shadow Inner Shadow
        context.saveGState()
        context.clip(to: bottomShadowPath.bounds)
        context.setShadow(offset: CGSize.zero, blur: 0)
        context.setAlpha((keyDarkShadow.shadowColor as! UIColor).cgColor.alpha)
        context.beginTransparencyLayer(auxiliaryInfo: nil)
        let bottomShadowOpaqueShadow = (keyDarkShadow.shadowColor as! UIColor).withAlphaComponent(1)
        context.setShadow(offset: CGSize(width: keyDarkShadow.shadowOffset.width * resizedShadowScale, height: keyDarkShadow.shadowOffset.height * resizedShadowScale), blur: keyDarkShadow.shadowBlurRadius * resizedShadowScale, color: bottomShadowOpaqueShadow.cgColor)
        context.setBlendMode(.sourceOut)
        context.beginTransparencyLayer(auxiliaryInfo: nil)

        bottomShadowOpaqueShadow.setFill()
        bottomShadowPath.fill()

        context.endTransparencyLayer()
        context.endTransparencyLayer()
        context.restoreGState()
        
        context.restoreGState()

    }




    @objc(ZX48KeyboardStyleKitResizingBehavior)
    public enum ResizingBehavior: Int {
        case aspectFit /// The content is proportionally resized to fit into the target rectangle.
        case aspectFill /// The content is proportionally resized to completely fill the target rectangle.
        case stretch /// The content is stretched to match the entire target rectangle.
        case center /// The content is centered in the target rectangle, but it is NOT resized.

        public func apply(rect: CGRect, target: CGRect) -> CGRect {
            if rect == target || target == CGRect.zero {
                return rect
            }

            var scales = CGSize.zero
            scales.width = abs(target.width / rect.width)
            scales.height = abs(target.height / rect.height)

            switch self {
                case .aspectFit:
                    scales.width = min(scales.width, scales.height)
                    scales.height = scales.width
                case .aspectFill:
                    scales.width = max(scales.width, scales.height)
                    scales.height = scales.width
                case .stretch:
                    break
                case .center:
                    scales.width = 1
                    scales.height = 1
            }

            var result = rect.standardized
            result.size.width *= scales.width
            result.size.height *= scales.height
            result.origin.x = target.minX + (target.width - result.width) / 2
            result.origin.y = target.minY + (target.height - result.height) / 2
            return result
        }
    }
}



private extension UIColor {
    func withHue(_ newHue: CGFloat) -> UIColor {
        var saturation: CGFloat = 1, brightness: CGFloat = 1, alpha: CGFloat = 1
        self.getHue(nil, saturation: &saturation, brightness: &brightness, alpha: &alpha)
        return UIColor(hue: newHue, saturation: saturation, brightness: brightness, alpha: alpha)
    }
    func withSaturation(_ newSaturation: CGFloat) -> UIColor {
        var hue: CGFloat = 1, brightness: CGFloat = 1, alpha: CGFloat = 1
        self.getHue(&hue, saturation: nil, brightness: &brightness, alpha: &alpha)
        return UIColor(hue: hue, saturation: newSaturation, brightness: brightness, alpha: alpha)
    }
    func withBrightness(_ newBrightness: CGFloat) -> UIColor {
        var hue: CGFloat = 1, saturation: CGFloat = 1, alpha: CGFloat = 1
        self.getHue(&hue, saturation: &saturation, brightness: nil, alpha: &alpha)
        return UIColor(hue: hue, saturation: saturation, brightness: newBrightness, alpha: alpha)
    }
    func withAlpha(_ newAlpha: CGFloat) -> UIColor {
        var hue: CGFloat = 1, saturation: CGFloat = 1, brightness: CGFloat = 1
        self.getHue(&hue, saturation: &saturation, brightness: &brightness, alpha: nil)
        return UIColor(hue: hue, saturation: saturation, brightness: brightness, alpha: newAlpha)
    }
    func highlight(withLevel highlight: CGFloat) -> UIColor {
        var red: CGFloat = 1, green: CGFloat = 1, blue: CGFloat = 1, alpha: CGFloat = 1
        self.getRed(&red, green: &green, blue: &blue, alpha: &alpha)
        return UIColor(red: red * (1-highlight) + highlight, green: green * (1-highlight) + highlight, blue: blue * (1-highlight) + highlight, alpha: alpha * (1-highlight) + highlight)
    }
    func shadow(withLevel shadow: CGFloat) -> UIColor {
        var red: CGFloat = 1, green: CGFloat = 1, blue: CGFloat = 1, alpha: CGFloat = 1
        self.getRed(&red, green: &green, blue: &blue, alpha: &alpha)
        return UIColor(red: red * (1-shadow), green: green * (1-shadow), blue: blue * (1-shadow), alpha: alpha * (1-shadow) + shadow)
    }
    func blended(withFraction fraction: CGFloat, of color: UIColor) -> UIColor {
        var r1: CGFloat = 1, g1: CGFloat = 1, b1: CGFloat = 1, a1: CGFloat = 1
        var r2: CGFloat = 1, g2: CGFloat = 1, b2: CGFloat = 1, a2: CGFloat = 1

        self.getRed(&r1, green: &g1, blue: &b1, alpha: &a1)
        color.getRed(&r2, green: &g2, blue: &b2, alpha: &a2)

        return UIColor(red: r1 * (1 - fraction) + r2 * fraction,
            green: g1 * (1 - fraction) + g2 * fraction,
            blue: b1 * (1 - fraction) + b2 * fraction,
            alpha: a1 * (1 - fraction) + a2 * fraction);
    }
}
